import Link from 'next/link';

const Header = () => (
  <header>
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/login">
      <a>Login</a>
    </Link>
    <Link href="/signup">
      <a>Signup</a>
    </Link>
  </header>
);

export default Header;
